import struct
def getUint32(index):
#     print(rawBuffer[index:index+4])
    return struct.unpack(">I", rawBuffer[index:index+4])[0]


def setUint32(index, val):
    rawBuffer[index:index+4] = bytearray(struct.pack(">I", val))

